    const [description,setDescription] = useState("");

    function addProduct()
{
    console.warn(title,file,price,description)
}
    return (
        

       
        <div className="col-sm-6 offset-sm-4">
           <br />
            <inputs type="text" className="form-control" onChange={e =>setTitle(e.target.value)} placeholder="title"/><br />
            <inputs type="file" className="form-control" onChange={e =>setFile(e.target.files[0])} placeholder="file"/><br />
            <inputs type="text" className="form-control" onChange={e =>setPrice(e.target.value)} placeholder="price"/><br />
